import React from 'react';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import checkAuth from "./components/Authenticate/CheckAuth";

function App() {
  return (
    <div>
      <Navbar />
      <div className="customBg">
        <div id="medicineCarousel" className="carousel slide" data-ride="carousel" style={{ maxWidth: '1200px', margin: 'auto' }}>
          <div className="carousel-inner">
            <div className="carousel-item active">
              <img src="/stock/stock1.png" className="d-block w-100" alt="Medicine 1" style={{ objectFit: 'cover', maxHeight: '400px' }} />
            </div>
            <div className="carousel-item">
              <img src="/stock/stock2.png" className="d-block w-100" alt="Medicine 2" style={{ objectFit: 'cover', maxHeight: '400px' }} />
            </div>
            {/* Add more carousel items with different images */}
          </div>
          <a className="carousel-control-prev" href="#medicineCarousel" role="button" data-slide="prev">
            <span className="carousel-control-prev-icon" aria-hidden="true"></span>
            <span className="sr-only">Previous</span>
          </a>
          <a className="carousel-control-next" href="#medicineCarousel" role="button" data-slide="next">
            <span className="carousel-control-next-icon" aria-hidden="true"></span>
            <span className="sr-only">Next</span>
          </a>
        </div>
      </div>
    </div>
  );
}

export default App;
